import React from 'react';
import "./css/Startseite.css";

class Home extends React.Component {
	render(){
		return (
			<>

				<a className="host_room" href="/host">
					Einen Raum erstellen
				</a>
				
				<button onclick="window.location='/Room';" value="click here" />
					Einen vorhandenen Raum beitreten
				
			</>
		);
	};
}
export default Home;
